import React from "react";
import "./Intro.css";
import Github from "../../img/github.png";
import LinkedIn from "../../img/linkedin.png";
import Instagram from "../../img/instagram.png";
import Vector1 from "../../img/Vector1.png";
import Vector2 from "../../img/Vector2.png";
import boy from "../../img/boy.png";
import glassesimoji from "../../img/glassesimoji.png";
import thumbup from "../../img/thumbup.png";
import crown from "../../img/crown.png";

function Intro() {
  return (
    <div className="intro">
      <div className="i-left"></div>
      <div className="i-name">
        <span>Hey, I Am</span>
        <span>Shuai(Lily) Feng</span>
        <span>
          Graduate student majoring in Computer Science at Upenn, with a
          background in Architecture and Engineering. Throughout my work as an
          Architect, a Designer and a Software Developer, my mission is to help
          people design a better lives, and I do that by combining my technical
          skills and collaborative approach to produce innovative solutions.
        </span>
      </div>
      <button className="button i-button">Hire me</button>
      <div className="i-icons">
        <a href="https://github.com/fshuai822">
          <img src={Github} alt="" />
        </a>
        <a href="https://www.linkedin.com/in/shuai-feng">
          <img src={LinkedIn} alt="" />
        </a>
        <a href="https://www.instagram.com/sfeng_22/">
          <img src={Instagram} alt="" />
        </a>
      </div>
    </div>
  );
}

export default Intro;
